import React from 'react'
import './Achievements.css'

function Achievements() {

    const totalDays = (new Date(year + 1, 0, 1) - new Date(year, 0, 1)) / (1000 * 60 * 60 * 24);


    return (
        <div className='Achievements'>{totalDays}</div>
    )
}

export default Achievements
